import React, { useEffect, useState } from 'react';
import { getTodos } from './services/todoService';

const App: React.FC = () => {
  const [todos, setTodos] = useState<any[]>([]);

  useEffect(() => {
    getTodos().then(setTodos);
  }, []);

  return (
    <div>
      <h1>Todo List</h1>
      <ul>
        {todos.map(todo => <li key={todo.id}>{todo.title}</li>)}
      </ul>
    </div>
  );
};

export default App;
